import React, { Component } from 'react'
import TextField from '@material-ui/core'

class login extends Component {
    state = {
        email: '',
        password: ''
    }

    handleChange = (e) => {
        const {name, value} = e.target
        this.setState({[name]: value})
    }

    render() {
        return (
            <div style={{textAlign: 'center'}}>
                <TextField onChange={this.handleChange} value={this.state.email} name='email' type='text' label='Email'/>
                <TextField onChange={this.handleChange} value={this.state.password} name='password' type='text' label='Password'/>
            </div>
        )
    }
}

export default login
